import React from 'react';
import './App.css';

export default class RandomGenerator extends React.Component {

  render () {
    return (
      <div>
        <input type="string" className="top-input" />
        <input type="string" className="bottom-input" />
        <input type="number" className="font-size-input" />
        <button type="button"> Random </button>
      </div>
    );
  }
}
